import React, {Component} from 'react';
import Splash from './Splash.jpg';
import Splash1 from './Splash1.jpg';
import Splash2 from './Splash2.jpg';
import Carousel from 'react-bootstrap/lib/Carousel';

class Home extends React.Component {

  render() {

  return (
    <Carousel>
      <Carousel.Item>
        <img width={900} height={400} alt="900x400" src={Splash1} />
        <Carousel.Caption>
          <h3>First slide label</h3>
          <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
        </Carousel.Caption>
      </Carousel.Item>
      <Carousel.Item>
        <img width={900} height={400} alt="900x400" src={Splash} />
        <Carousel.Caption>
          <h3>Second slide label</h3>
          <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
        </Carousel.Caption>
      </Carousel.Item>
      <Carousel.Item>
        <img width={900} height={400} alt="900x400" src={Splash2} />
        <Carousel.Caption>
          <h3>Third slide label</h3>
          <p>Praesent commodo cursus magna, vel scelerisque nisl consectetur.</p>
        </Carousel.Caption>
      </Carousel.Item>
    </Carousel>
);
 }
}

export default Home;
